window.bookSummaryJSON = "<p><b>Fate made her his. He just has to hunt her down...</b></p> <p>For centuries, Emma has sought to keep herself from being bound to a mate, immortal or otherwise. But Jean-Cristophe is an alpha wolf, and he will take what belongs to him.</p> <p>She will be claimed, marked, and ravaged until she screams his name, even if that means first stripping her bare and spanking her until she is sore, sobbing, and shamefully in need.</p> <p><b>Publisher's note:</b> <i>Fated</i> includes spankings and rough, intense sexual scenes. If such material offends you, please don't buy this audiobook.</p>"; 
